value.dp_description:
Data on active child support cases observed once at a point-in-time, including:
* demographic details for a PAYER vs. PAYEE of a case;
* ASSESSABLE INCOME details for a payer vs. payee of a case;
* ELIGIBLE children details;
* RELEVANT children details (i.e. details for children of one or more subsequent relationships of a 'payer' or 'payee'); and
* Child Support COLLECTION details (i.e. liability assessments, collection methods, debts by type of debts, etc.).​​​​
